import React from "react";
import {Menu, MenuItem} from "react-foundation";
import {MenuAlignments as Alignments} from "react-foundation/src/enums";

const Home = () => (
    <div alignment={Alignments.CENTER}>
        <h2>This is the homepage</h2>
    </div>
);

export default Home;
